#include <iostream>

class Base {
};

class Derived : public Base {
};

int main() {
    Base* bptr = new Derived();

    Derived* dptr = static_cast<Derived*>(bptr);

    std::cout << dptr << std::endl;
}

In the above code, I should be using dynamic_cast but am using
static_cast incorrectly. static_cast should never be used while
downcasting, since compiler has no way to determine we are doing
cast correctly.
Why isn't this a compile error ? I am using gcc 4.9.2. Do you guys
think this is a bug in the compiler, or does C++ standards allow such code ?
Edit: Thanks for the responses. Actually, Base class above is polymorphic
i.e. it has virtual functions, but I left them out for this example. I should
have thrown in a virtual destructor in the Base to make it clear that it
was polymorphic - my bad.,"#include <iostream> class base { }; class derived : public base { }; int main() { base* bptr = new derived(); derived* dptr = static_cast<derived*>(bptr); std::cout << dptr << std::endl; } in the above code, i should be using dynamic_cast but am using static_cast incorrectly. static_cast should never be used while downcasting, since compiler has no way to determine we are doing cast correctly. why isn't this a compile error ? i am using gcc 4.9.2. do you guys think this is a bug in the compiler, or does c++ standards allow such code ? edit: thanks for the responses. actually, base class above is polymorphic i.e. it has virtual functions, but i left them out for this example. i should have thrown in a virtual destructor in the base to make it clear that it was polymorphic - my bad.",en,809,141,18,3,20,4.481410651670624,0.022222222222222223,0.003703703703703704,0.024691358024691357,4.617021276595745,0.7021276595744681,12,0,1,0,1,0,0,0,0,0,1

Ok folks I have bombed around for  a few days trying to find a good solution for this one. 
What I have is two possible address formats.
28 Main St Somecity, NY 12345-6789    
or 
Main St Somecity, Ny 12345-6789

What I need to do Is split both strings down into an array structured as such 
address[0] = HousNumber 
address[1] = Street 
address[2] = City 
address[3] = State 
